import logo from './logo.svg';
import './App.css';  
import Header from './components/Header';
import { Container, Row, Col } from 'reactstrap';

class App extends React.Component {
   render() {
      return (
         <div>
            <h1>Header</h1>
            <h2>Content</h2>
            <p>This is the content!!!</p>
         </div>
      );
   }
}

export default App;
